import { Component, OnInit } from '@angular/core';
import { Router } from '@angular/router';
import { TokenService } from 'src/app/service/token.service';

@Component({
  selector: 'app-logo',
  templateUrl: './logo.component.html',
  styleUrls: ['./logo.component.css']
})
export class LogoComponent implements OnInit {
  isLogger = false;

  constructor(private router:Router, private tokenService: TokenService){

  }
  ngOnInit(): void {
    if(this.tokenService.getToken()){
      this.isLogger = true;
    }else{
      this.isLogger = false;
    }

  }
onLogOut():void{
this.tokenService.logOut();
window.location.reload();

}

login(){
this.router.navigate(['/login'])

}
}
<div class="row">
        <div class="container">
                <div class="logo">
                        <img src="../../../assets/img/Logo.png" id="logoag">
                </div>
                <div class="reds">
                        <a href=""><img src="../../../assets/img/facebook.png" id="facebook" ></a>
                        <a href=""><img src="../../../assets/img/twitter.png" id="twitter"></a>
                        <a href=""><img src="../../../assets/img/github.png" id="github"></a>
                        <a href=""><img src="../../../assets/img/instagram.png" id="instagram"></a>
                        <a href=""><img src="../../../assets/img/linkedin.png" id="linkedin"></a>
                        <button type="button" class="btn  btn-primary" (click)="login()">Entrar</button>

                </div>
        </div>

</div>
